import React from 'react'
import { course } from '../App'

const Header = ({ text }) => {
  return (
    <h1>{text}</h1>
  )
}

const Content = ({ course }) => {

  const Part = () => {
    return (
      <p>{course.name} {course.exercises}</p>
    )
  }
}

const Course = ({ course }) => {
  console.log(course)
  return (
    <>
      <Header course={course} text='Half Stack application development'/>
    </>
  )
}

export default Course
